import React from "react";

const FormModal = () => {
	return (
		<>
			<form  id='form-data'>
				<label id='email'>Name</label>
				<input
					className='cus-input'
					type='text'
					name='user[email]'
					placeholder='Email'
					// onChange={(e) =>
					// 	setUser({ ...user, email: e.target.value })}>
				></input>
				<label id='email'>Number</label>
				<input
					className='cus-input'
					name='user'
					type='text'
					placeholder='Password'
					// onChange={(e) =>
					// 	setUser({ ...user, password: e.target.value })}
				></input>
				<input id='submit-btn' type='submit' value='Submit'></input>
			</form>
		</>
	);
};

export default FormModal;
